import React from 'react'
import './Checkbox.css';

export const CheckBox = props => {
    return (
        <li>
        <div class="checkbox">
          <input type="checkbox"type="checkbox" onChange={props.handleCheckElement} checked={props.isChecked} value="checked" />
          <label for="check">
            <span></span>{props.value}
          </label>
        </div>
      </li>
    )
}

export default CheckBox
